import "./Skills.css";

export function Skills() {
  return (
    <div id="aboutme" className="about-page flex">
      <div className="screen-max flex">
        <div className="skills-page-container"></div>
            <div className="skills-title section-title">Skills<span>.</span></div>

            <div className="skills-section">
                <div className="skills-subtitle">Web Development</div>
            </div>
      </div>
    </div>
  );
}
